list.html.body:
list のインスタンスを作る
boost::python::list, list.append を使う。
構文
namespace boost::python
{
    class list
    {
    public:
        void append(const object&);
    };
}

具体例
#include 
namespace python = boost::python;

python::object make_list()
{
    python::list li;
    li.append(1);
    li.append(2.3);
    li.append("test");
    return li;
}

