len.html.body:
list, tuple の長さを取得する
boost::python::len 関数を使う。
構文
namespace boost::python
{
    ssize_t len(object& obj);
}

具体例
#include 
namespace python = boost::python;

int get_list_length(python::list obj)
{
    return python::len(obj);
}

